import logo from './logo.svg';
import './App.css';
import Banner from './banner';
import Services from './services';
import Programs from './programs';
function App() {
  return (
    <div className="App">
     <Banner />
     <Services />
     <Programs />
     
    </div>
  );
}

export default App;
